    const [placesByMetro, setPlacesByMetro] = useState([]);
    const [cookies, setCookie, removeCookie] = useCookies(['user'])
    const [user, setUser] = useState(null)
    const [savedPlaces, setSavedPlaces] = useState([])


    useEffect(() => {
      // Fetch lovved-in user's data from backend API
      const fetchPlaces = async () => {
        try {
          const response = await axios.get(`http://localhost:8000/user?userId=${cookies.user_id}`)
          setUser(response.data);
          setSavedPlcaes(response.data.saved_places || [])
        } catch (error) {
          console.log(error);
        }
      };

      fetchUserData();
    }, [cookies.user_id]);





    return (
        <>
        {user && 
            <div>
            <h1>List of Places</h1>
            {placesByMetro.map((metro) => (
                <div key={metro._id}>
                <h2>{metro.place_metro}</h2>
                <ul>
                    {metro.places.map((place) => (
                    <li key={place._id}>
                        <h3>{place.place_name}</h3>
                        <p>{place.place_street}</p>
                        <p>{place.place_city}{', '}{place.place_state}{' '}{place.place_zip}</p>
                        <a href={place.place_url}>Website</a>
                        <p>{place.place_about}</p>
                    </li>
                    ))}
                </ul>
                </div>
            ))}
            </div>
        }</>
        );
};


export default MyPlaces
